							[~But that's actually kinda...\\n deep, and ... philosophical.~],
							set(frogatto.animation, 'emote_confused'),
							set(level.zoom, 3),
							[~This is pretty intense.~],
							set(level.focus, [prospera]),
							set(level.zoom, 3),
							execute(prospera, [set(prospera.animation, 'emote_cross_arms'); sleep_until_animation_finished(); set(prospera.animation, 'emote_talk_with_arms_crossed')]),
				prospera,	[~<em>I turned you into a frog.</em>\\nClue into that already!~],
							set(level.zoom, 2.5),
							set(prospera.animation, 'emote_talk_with_arms_crossed'),
							[~See, if you ask nicely, I might turn you back.~],
							set(level.zoom, 1.5),
							set(level.focus, [frogatto]),
							set(frogatto.animation, 'emote_confused'),
				frogatto,	[~I'm not sure this worked out\\nthe way you seem to think...~],
							set(level.focus, [camera_prospera]),
							execute(prospera, [set(prospera.animation, 'emote_uncross_arms'); sleep_until_animation_finished(); set(prospera.animation, 'emote_annoyed')]),
				prospera,	[~Which part?\\nI mean, you're quite clearly a frog.~],
							set(frogatto.animation, 'emote_geez'),
							set(level.zoom, 2),
							set(level.focus, [camera_frogatto]),
