							set(prospera.animation, 'emote_surprised'),
				prospera,	[~... wait.  What?!~],
							set(prospera.animation, 'emote_surprised'),
							[~You were already a frog <em>BEFORE</em> I did that?!?~],
							set(level.zoom, 1.5),
